import Vue from 'vue';
//引入全局初始化样式
import "@/assets/css/resets";
//引入页面全局公共样式
import "@/assets/css/style";
import "@/assets/css/common";
//引入iview
import "@/libs/iview";
// 引入组件
import App from '@/views/admin/index/index.vue';
//引入路由
import router from "@/libs/router"

Vue.config.productionTip = false;

/* eslint-disable no-new */


new Vue({
  router,
  render: h => h(App),
}).$mount('#app')
